import React from "react";
import RoboCard from "./RoboCard";
import {robots} from "./robots";

const RoboArray = () => {

return (
	<div>
		<RoboCard name={robots[0].name} />
		<RoboCard name={robots[1].name} />
		<RoboCard name={robots[2].name} />
		<RoboCard name={robots[3].name} />
	</div>
	)
}

export default RoboArray;
